INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, 1, 190804, 0, 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 60000, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 0, 1, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 1, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, 0, 0, 0, 2, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 0, 1, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, 0, 0, 0, 2, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 0, 2, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, 0, 0, 0, 2, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 0, 2, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, 0, 0, 0, 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 0, 2, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, 0, 0, 0, 2, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 0, 3, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, 0, 0, 0, 2, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 0, 3, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, 0, 0, 0, 2, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 3, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, 0, 0, 0, 2, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 3, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, 0, 0, 0, 2, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 0, 3, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, 0, 0, 0, 2, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 0, 4, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, 0, 0, 0, 2, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 0, 4, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, 0, 0, 0, 2, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 0, 4, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, 0, 0, 0, 2, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 4, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, 0, 0, 0, 2, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 4, 60000, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, 2, 190804, 0, 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, 0, 60000, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, 3, 190804, 0, 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 7, 0, 60000, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, 1, 101201, 0, 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", "", 1, 0, 80001, "ハツネ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, 2, 101201, 0, 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", "", 1, 0, 80001, "ハツネ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, 1, 103801, 0, 1, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", "", 1, 0, 80001, "シオリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, 2, 103801, 0, 1, 0, "来年も、\n一緒にいられたら…\nうれしいな", "", 1, 0, 80001, "シオリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, 1, 103601, 0, 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", "", 2, 0, 80001, "キョウカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, 2, 103601, 0, 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", "", 2, 0, 80001, "キョウカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, 1, 102001, 0, 1, 0, "おにいちゃんとあってから、\n1年たったよ～！", "", 2, 0, 80001, "ミミ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, 2, 102001, 0, 1, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", "", 2, 0, 80001, "ミミ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, 1, 100401, 0, 2, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", "", 2, 0, 80001, "ミソギ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, 2, 100401, 0, 2, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", "", 2, 0, 80001, "ミソギ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, 1, 101001, 0, 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", "", 3, 0, 80001, "マホ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, 2, 101001, 0, 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", "", 3, 0, 80001, "マホ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, 1, 104401, 0, 1, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", "", 3, 0, 80001, "イリヤ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, 2, 104401, 0, 1, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", "", 3, 0, 80001, "イリヤ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, 1, 101701, 0, 2, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", "", 3, 0, 80001, "カオリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, 2, 101701, 0, 2, 0, "これからも、どうぞよろしく\nお願いするさ～！", "", 3, 0, 80001, "カオリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, 1, 102801, 0, 0, 0, "あんたと出会ってからもうそんなに\nたつのね～", "", 4, 0, 80001, "サレン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, 2, 102801, 0, 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", "", 4, 0, 80001, "サレン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, 1, 102501, 0, 1, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", "", 4, 0, 80001, "スズメ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, 2, 102501, 0, 1, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", "", 4, 0, 80001, "スズメ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, 1, 104601, 0, 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", "", 5, 0, 80001, "タマキ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, 2, 104601, 0, 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", "", 5, 0, 80001, "タマキ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, 1, 104801, 0, 1, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", "", 5, 0, 80001, "ミフユ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, 2, 104801, 0, 1, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", "", 5, 0, 80001, "ミフユ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, 1, 103201, 0, 0, 0, "あなたさまと出会ってもう1年…", "", 6, 0, 80001, "アキノ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, 2, 103201, 0, 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", "", 6, 0, 80001, "アキノ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (46, 1, 103401, 0, 1, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", "", 6, 0, 80001, "ユカリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (47, 2, 103401, 0, 1, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", "", 6, 0, 80001, "ユカリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (48, 1, 107101, 0, 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", "", 7, 0, 80001, "クリスティーナ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (49, 2, 107101, 0, 0, 0, "ともかくこれからも\n愉しませてくれよ☆", "", 7, 0, 80001, "クリスティーナ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (50, 1, 104701, 0, 1, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", "", 7, 0, 80001, "ジュン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (51, 2, 104701, 0, 1, 0, "見えないから分からないって？\nそれもそうだな…", "", 7, 0, 80001, "ジュン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (52, 1, 103701, 0, 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", "", 8, 0, 80001, "トモ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (53, 2, 103701, 0, 0, 0, "これからもよろしくね！", "", 8, 0, 80001, "トモ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (54, 1, 100501, 0, 1, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", "", 8, 0, 80001, "マツリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (55, 2, 100501, 0, 1, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", "", 8, 0, 80001, "マツリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (56, 1, 100701, 0, 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", "", 9, 0, 80001, "ミヤコ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (57, 2, 100701, 0, 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", "", 9, 0, 80001, "ミヤコ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (58, 1, 103101, 0, 1, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", "", 9, 0, 80001, "シノブ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (59, 2, 103101, 0, 1, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", "", 9, 0, 80001, "シノブ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (60, 1, 100901, 0, 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", "", 10, 0, 80001, "アンナ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (61, 2, 100901, 0, 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", "", 10, 0, 80001, "アンナ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (62, 1, 101301, 0, 1, 0, "君と出会ってもう1年だって！\n早いねー！", "", 10, 0, 80001, "ナナカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (63, 2, 101301, 0, 1, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", "", 10, 0, 80001, "ナナカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (64, 1, 105101, 0, 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", "", 11, 0, 80001, "ミツキ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (65, 2, 105101, 0, 0, 0, "これからも、いろんなところを\n調べさせてね？", "", 11, 0, 80001, "ミツキ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (66, 1, 105601, 0, 1, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", "", 11, 0, 80001, "ルカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (67, 2, 105601, 0, 1, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", "", 11, 0, 80001, "ルカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (68, 1, 102701, 0, 2, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", "", 11, 0, 80001, "エリコ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (69, 2, 102701, 0, 2, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", "", 11, 0, 80001, "エリコ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (70, 1, 102301, 0, 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", "", 12, 0, 80001, "アヤネ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (71, 2, 102301, 0, 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", "", 12, 0, 80001, "アヤネ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (72, 1, 104201, 0, 1, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", "", 12, 0, 80001, "チカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (73, 2, 104201, 0, 1, 0, "私のことを見守ってください\nできることなら、ずっと…", "", 12, 0, 80001, "チカ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (74, 1, 102101, 0, 2, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", "", 12, 0, 80001, "クルミ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (75, 2, 102101, 0, 2, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", "", 12, 0, 80001, "クルミ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (76, 1, 104901, 0, 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", "", 13, 0, 80001, "シズル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (77, 2, 104901, 0, 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", "", 13, 0, 80001, "シズル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (78, 1, 101101, 0, 1, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", "", 13, 0, 80001, "リノ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (79, 2, 101101, 0, 1, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", "", 13, 0, 80001, "リノ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (80, 1, 100201, 0, 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", "", 14, 0, 80001, "ユイ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (81, 2, 100201, 0, 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", "", 14, 0, 80001, "ユイ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (82, 1, 100101, 0, 1, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", "", 14, 0, 80001, "ヒヨリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (83, 2, 100101, 0, 1, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", "", 14, 0, 80001, "ヒヨリ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (84, 1, 100301, 0, 2, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", "", 14, 0, 80001, "レイ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (85, 2, 100301, 0, 2, 0, "キミに背中を預けられる日が、\n早くきますように", "", 14, 0, 80001, "レイ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (86, 1, 105801, 0, 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", "", 15, 0, 80001, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (87, 2, 105801, 0, 0, 0, "これからもずっと、覚えていて\nくださいね！", "", 15, 0, 80001, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (88, 1, 105901, 0, 1, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", "", 15, 0, 80001, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (89, 2, 105901, 0, 1, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", "", 15, 0, 80001, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (90, 1, 106001, 0, 2, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", "", 15, 0, 80001, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (91, 2, 106001, 0, 2, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", "", 15, 0, 80001, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (92, 1, 112101, 0, 1, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", "", 0, 0, 60001, "スズメ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (93, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "", 0, 1, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (94, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 1, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (95, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 0, 1, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (96, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 0, 1, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (97, 0, 0, 0, 2, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "", 0, 1, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (98, 0, 0, 0, 2, 1, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "", 0, 2, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (99, 0, 0, 0, 2, 1, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "", 0, 2, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (100, 0, 0, 0, 2, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 0, 2, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (101, 0, 0, 0, 2, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 0, 2, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (102, 0, 0, 0, 2, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "", 0, 2, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (103, 0, 0, 0, 2, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (104, 0, 0, 0, 2, 1, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (105, 0, 0, 0, 2, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (106, 0, 0, 0, 2, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (107, 0, 0, 0, 2, 1, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (108, 0, 0, 0, 2, 1, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (109, 0, 0, 0, 2, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "", 0, 3, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (110, 0, 0, 0, 2, 1, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (111, 0, 0, 0, 2, 1, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (112, 0, 0, 0, 2, 1, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (113, 0, 0, 0, 2, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (114, 0, 0, 0, 2, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (115, 0, 0, 0, 2, 1, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (116, 0, 0, 0, 2, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 4, 60001, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (117, 2, 112101, 0, 3, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", "", 0, 0, 60001, "スズメ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (118, 3, 112101, 0, 3, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", "", 7, 0, 60001, "スズメ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (119, 1, 105801, 0, 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", "", 1, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (120, 1, 105901, 0, 1, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", "", 1, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (121, 2, 105901, 0, 1, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "", 1, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (122, 1, 106001, 0, 2, 0, "え？　ちょっと\nいきなりなにっ？", "", 1, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (123, 2, 106001, 0, 2, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", "", 1, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (124, 2, 105801, 0, 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "", 1, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (125, 3, 105801, 0, 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "", 1, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (126, 3, 105901, 0, 1, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", "", 1, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (127, 3, 106001, 0, 2, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", "", 1, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (128, 4, 105901, 0, 1, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", "", 1, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (129, 4, 105801, 0, 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "", 1, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (130, 4, 106001, 0, 2, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "", 1, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (131, 5, 105901, 0, 1, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "", 1, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (132, 5, 106001, 0, 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (133, 1, 190801, 0, 1, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "", 2, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (134, 6, 106001, 0, 0, 0, "げっ…カリンじゃない\nなんでもないわよ！", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (135, 2, 190801, 0, 1, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "", 2, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (136, 7, 106001, 0, 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (137, 3, 190801, 0, 1, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "", 2, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (138, 8, 106001, 0, 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (139, 9, 106001, 0, 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (140, 4, 190801, 0, 1, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "", 2, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (141, 10, 106001, 0, 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (142, 5, 190801, 0, 1, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "", 2, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (143, 11, 106001, 0, 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "", 2, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (144, 6, 105901, 0, 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (145, 5, 105801, 0, 1, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (146, 7, 105901, 0, 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (147, 8, 105901, 0, 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (148, 6, 105801, 0, 1, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (149, 7, 105801, 0, 1, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (150, 9, 105901, 0, 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (151, 8, 105801, 0, 1, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (152, 10, 105901, 0, 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (153, 9, 105801, 0, 1, 0, "えへへ、ありがとうございます\nコッコロちゃん！", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (154, 11, 105901, 0, 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "", 3, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (155, 10, 105801, 0, 1, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "", 3, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (156, 11, 105801, 0, 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (157, 12, 106001, 0, 1, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (158, 12, 105801, 0, 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (159, 13, 106001, 0, 1, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (160, 13, 105801, 0, 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (161, 14, 106001, 0, 1, 0, "…積極的？\nなんの話よ？", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (162, 14, 105801, 0, 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (163, 15, 105801, 0, 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (164, 15, 106001, 0, 1, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (165, 16, 105801, 0, 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "", 4, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (166, 16, 106001, 0, 1, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (167, 17, 106001, 0, 1, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "", 4, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (168, 18, 106001, 0, 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (169, 12, 105901, 0, 1, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "", 5, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (170, 19, 106001, 0, 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (171, 13, 105901, 0, 1, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "", 5, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (172, 20, 106001, 0, 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (173, 14, 105901, 0, 1, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "", 5, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (174, 21, 106001, 0, 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (175, 15, 105901, 0, 1, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "", 5, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (176, 22, 106001, 0, 0, 0, "かくし芸？", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (177, 16, 105901, 0, 1, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "", 5, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (178, 23, 106001, 0, 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "", 5, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (179, 17, 105801, 0, 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "", 6, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (180, 24, 106001, 0, 2, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (181, 17, 105901, 0, 1, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "", 6, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (182, 18, 105801, 0, 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "", 6, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (183, 25, 106001, 0, 2, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (184, 18, 105901, 0, 1, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "", 6, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (185, 26, 106001, 0, 2, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (186, 27, 106001, 0, 2, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (187, 28, 106001, 0, 2, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (188, 19, 105801, 0, 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "", 6, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (189, 19, 105901, 0, 1, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "", 6, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (190, 29, 106001, 0, 2, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "", 6, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (191, 30, 106001, 0, 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (192, 31, 106001, 0, 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (193, 32, 106001, 0, 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (194, 33, 106001, 0, 0, 0, "あー\nあー\n…声、これで大丈夫かしら？", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (195, 34, 106001, 0, 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (196, 35, 106001, 0, 0, 0, "オイッスー☆", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (197, 36, 106001, 0, 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (198, 37, 106001, 0, 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (199, 38, 106001, 0, 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", "", 7, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (200, 20, 105901, 0, 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (201, 21, 105901, 0, 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (202, 22, 105901, 0, 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (203, 23, 105901, 0, 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (204, 24, 105901, 0, 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (205, 25, 105901, 0, 0, 0, "オイッスー☆", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (206, 26, 105901, 0, 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (207, 27, 105901, 0, 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (208, 28, 105901, 0, 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "", 8, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (209, 20, 105801, 0, 0, 0, "オイッスー☆", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (210, 21, 105801, 0, 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (211, 22, 105801, 0, 0, 0, "あと６日で2.5周年ですか…", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (212, 23, 105801, 0, 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (213, 24, 105801, 0, 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (214, 25, 105801, 0, 0, 0, "オイッスー☆", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (215, 26, 105801, 0, 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (216, 27, 105801, 0, 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (217, 28, 105801, 0, 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (218, 29, 105801, 0, 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (219, 30, 105801, 0, 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "", 9, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (220, 31, 105801, 0, 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (221, 29, 105901, 0, 1, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "", 10, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (222, 32, 105801, 0, 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (223, 39, 106001, 0, 2, 0, "…………", "", 10, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (224, 30, 105901, 0, 1, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "", 10, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (225, 40, 106001, 0, 2, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "", 10, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (226, 33, 105801, 0, 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (227, 41, 106001, 0, 2, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "", 10, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (228, 34, 105801, 0, 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (229, 35, 105801, 0, 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (230, 42, 106001, 0, 2, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "", 10, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (231, 31, 105901, 0, 1, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "", 10, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (232, 43, 106001, 0, 2, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "", 10, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (233, 36, 105801, 0, 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "", 10, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (234, 6, 190801, 0, 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (235, 7, 190801, 0, 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (236, 8, 190801, 0, 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (237, 9, 190801, 0, 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (238, 10, 190801, 0, 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (239, 11, 190801, 0, 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (240, 12, 190801, 0, 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (241, 13, 190801, 0, 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (242, 14, 190801, 0, 0, 0, "あれ？\nもしかして緊張で気を失って…？", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (243, 15, 190801, 0, 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (244, 16, 190801, 0, 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (245, 17, 190801, 0, 0, 0, "それでは\nまた明日お会いしましょう♪", "", 11, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (246, 44, 106001, 0, 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "", 12, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (247, 37, 105801, 0, 2, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "", 12, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (248, 32, 105901, 0, 1, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "", 12, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (249, 45, 106001, 0, 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "", 12, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (250, 38, 105801, 0, 2, 0, "ひどいですよぉキャルちゃ～ん！", "", 12, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (251, 33, 105901, 0, 1, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "", 12, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (252, 39, 105801, 0, 2, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "", 12, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (253, 46, 106001, 0, 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "", 12, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (254, 34, 105901, 0, 1, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "", 12, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (255, 40, 105801, 0, 2, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "", 12, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (256, 41, 105801, 0, 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (257, 47, 106001, 0, 2, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (258, 42, 105801, 0, 0, 0, "忘れてきちゃいました☆", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (259, 48, 106001, 0, 2, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (260, 35, 105901, 0, 1, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "", 13, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (261, 49, 106001, 0, 2, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (262, 43, 105801, 0, 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (263, 50, 106001, 0, 2, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (264, 36, 105901, 0, 1, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "", 13, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (265, 51, 106001, 0, 2, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (266, 37, 105901, 0, 1, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "", 13, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (267, 52, 106001, 0, 2, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (268, 44, 105801, 0, 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (269, 38, 105901, 0, 1, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "", 13, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (270, 45, 105801, 0, 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (271, 53, 106001, 0, 2, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "", 13, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (272, 46, 105801, 0, 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "", 13, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (273, 18, 190801, 0, 0, 0, "こんにちは\n【ギルド管理協会】のカリンです", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (274, 19, 190801, 0, 0, 0, "昨日の生放送は\nいかがだったでしょうか？", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (275, 20, 190801, 0, 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (276, 21, 190801, 0, 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (277, 22, 190801, 0, 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (278, 23, 190801, 0, 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (279, 24, 190801, 0, 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (280, 25, 190801, 0, 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (281, 26, 190801, 0, 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (282, 27, 190801, 0, 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "", 14, 0, 80003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (283, 47, 105801, 0, 0, 0, "準備はいいですかっ？\n…いっきますよー！", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (284, 54, 106001, 0, 2, 0, "祝！", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (285, 39, 105901, 0, 1, 0, "2.5周年！", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (286, 48, 105801, 0, 0, 0, "おめでとうございま～す☆", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (287, 55, 106001, 0, 2, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (288, 40, 105901, 0, 1, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (289, 49, 105801, 0, 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (290, 56, 106001, 0, 2, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (291, 41, 105901, 0, 1, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (292, 57, 106001, 0, 2, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (293, 50, 105801, 0, 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (294, 58, 106001, 0, 2, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (295, 51, 105801, 0, 0, 0, "記念日だから\n平気平気♪\nやばいですね☆", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (296, 59, 106001, 0, 2, 0, "意味分かんないわよ！", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (297, 42, 105901, 0, 1, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (298, 43, 105901, 0, 1, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (299, 52, 105801, 0, 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (300, 60, 106001, 0, 2, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "", 15, 0, 80003, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (301, 44, 105901, 0, 1, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "", 15, 0, 80003, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (302, 53, 105801, 0, 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "", 15, 0, 80003, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (303, 54, 105801, 1, 0, 0, "2.5周年\nありがとうございます！", "105901,45,106001,61", 15, 0, 80003, "ペコリーヌ・コッコロ・キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (304, 1, 190804, 0, 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 60002, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (305, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 0, 1, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (306, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 1, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (307, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "", 0, 1, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (308, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "", 0, 1, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (309, 0, 0, 0, 2, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 0, 1, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (310, 0, 0, 0, 2, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 0, 2, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (311, 0, 0, 0, 2, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 0, 2, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (312, 0, 0, 0, 2, 1, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "", 0, 2, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (313, 0, 0, 0, 2, 1, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "", 0, 2, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (314, 0, 0, 0, 2, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 0, 2, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (315, 0, 0, 0, 2, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (316, 0, 0, 0, 2, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (317, 0, 0, 0, 2, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (318, 0, 0, 0, 2, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (319, 0, 0, 0, 2, 1, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (320, 0, 0, 0, 2, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (321, 0, 0, 0, 2, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "", 0, 3, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (322, 0, 0, 0, 2, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (323, 0, 0, 0, 2, 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (324, 0, 0, 0, 2, 1, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (325, 0, 0, 0, 2, 1, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (326, 0, 0, 0, 2, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (327, 0, 0, 0, 2, 1, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (328, 0, 0, 0, 2, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "", 0, 4, 60002, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (329, 2, 190804, 0, 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, 0, 60002, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (330, 3, 190804, 0, 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 7, 0, 60002, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (331, 1, 105901, 0, 4, 0, "ささ、シェフィさまはこちらへ…", "", 1, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (332, 1, 106401, 0, 0, 0, "コッコロさん、どこへ行くの…？\n…え？", "", 1, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (333, 1, 105801, 0, 3, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "", 1, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (334, 2, 105901, 0, 4, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "", 1, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (335, 2, 106401, 0, 0, 0, "ええと…\n二人とも何をしているの？", "", 1, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (336, 1, 106001, 0, 1, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "", 1, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (337, 3, 106401, 0, 0, 0, "あの日…？", "", 1, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (338, 2, 105801, 0, 3, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "", 1, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (339, 3, 105801, 0, 3, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", "", 1, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (340, 1, 190801, 0, 2, 0, "やばいですね☆", "", 1, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (341, 2, 106001, 0, 1, 0, "って、なにしれっと\n参加してんのよカリン！", "", 1, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (342, 2, 190801, 0, 2, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "", 1, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (343, 3, 190801, 0, 2, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "", 1, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (344, 4, 105801, 0, 3, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "", 1, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (345, 4, 106401, 0, 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", "", 1, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (346, 5, 105801, 0, 3, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "", 2, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (347, 3, 105901, 0, 1, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "", 2, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (348, 4, 105901, 0, 1, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "", 2, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (349, 6, 105801, 0, 3, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "", 2, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (350, 5, 105901, 0, 1, 0, "さすがでございます\nペコリーヌさま", "", 2, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (351, 3, 106001, 0, 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "", 2, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (352, 5, 106401, 0, 2, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", "", 2, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (353, 7, 105801, 0, 3, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "", 2, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (354, 6, 105901, 0, 1, 0, "さ、次はキャルさまの\n番でございますよ", "", 2, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (355, 4, 106001, 0, 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", "", 2, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (356, 6, 106401, 0, 2, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "", 2, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (357, 5, 106001, 0, 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "", 2, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (358, 6, 106001, 0, 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", "", 2, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (359, 7, 105901, 0, 1, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "", 2, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (360, 7, 106001, 0, 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "", 2, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (361, 8, 105901, 0, 1, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "", 3, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (362, 8, 105801, 0, 3, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "", 3, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (363, 9, 105901, 0, 1, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "", 3, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (364, 7, 106401, 0, 2, 0, "聖学祭…って、なにかしら？", "", 3, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (365, 10, 105901, 0, 1, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "", 3, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (366, 8, 106001, 0, 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "", 3, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (367, 9, 106001, 0, 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "", 3, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (368, 9, 105801, 0, 3, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "", 3, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (369, 10, 106001, 0, 0, 0, "いや、そのまんますぎでしょ…", "", 3, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (370, 8, 106401, 0, 2, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "", 3, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (371, 10, 105801, 0, 3, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "", 3, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (372, 9, 106401, 0, 2, 0, "えっ？　ええ…\nぎゅーっ…？", "", 3, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (373, 11, 106001, 0, 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (374, 10, 106401, 0, 2, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "", 4, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (375, 12, 106001, 0, 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (376, 11, 105901, 0, 1, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "", 4, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (377, 13, 106001, 0, 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (378, 11, 105801, 0, 3, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "", 4, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (379, 14, 106001, 0, 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (380, 15, 106001, 0, 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (381, 11, 106401, 0, 2, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "", 4, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (382, 12, 105801, 0, 3, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "", 4, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (383, 12, 105901, 0, 1, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "", 4, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (384, 16, 106001, 0, 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "", 4, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (385, 12, 106401, 0, 2, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "", 4, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (386, 13, 105801, 0, 3, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (387, 14, 105801, 0, 3, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (388, 15, 105801, 0, 3, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (389, 17, 106001, 0, 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "", 5, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (390, 18, 106001, 0, 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "", 5, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (391, 13, 106401, 0, 2, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "", 5, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (392, 13, 105901, 0, 1, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "", 5, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (393, 16, 105801, 0, 3, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (394, 19, 106001, 0, 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "", 5, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (395, 17, 105801, 0, 3, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (396, 18, 105801, 0, 3, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (397, 19, 105801, 0, 3, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "", 5, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (398, 4, 190801, 0, 2, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "", 6, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (399, 5, 190801, 0, 2, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "", 6, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (400, 20, 106001, 0, 1, 0, "…えっ！？", "", 6, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (401, 20, 105801, 0, 3, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "", 6, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (402, 14, 106401, 0, 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "", 6, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (403, 14, 105901, 0, 4, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "", 6, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (404, 15, 106401, 0, 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "", 6, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (405, 21, 106001, 0, 1, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "", 6, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (406, 21, 105801, 0, 3, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "", 6, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (407, 22, 106001, 0, 1, 0, "ぶっ殺すぞ！？", "", 6, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (408, 6, 190801, 0, 2, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "", 6, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (409, 15, 105901, 0, 1, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "", 7, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (410, 23, 106001, 0, 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "", 7, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (411, 16, 106401, 0, 2, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "", 7, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (412, 22, 105801, 0, 3, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "", 7, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (413, 24, 106001, 0, 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "", 7, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (414, 17, 106401, 0, 2, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "", 7, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (415, 16, 105901, 0, 1, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "", 7, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (416, 18, 106401, 0, 2, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "", 7, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (417, 17, 105901, 0, 1, 0, "もちろんでございます\n仲良くお勉強いたしましょう", "", 7, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (418, 25, 106001, 0, 0, 0, "しれっと教育ママが\n生まれてる…？", "", 7, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (419, 23, 105801, 0, 3, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "", 7, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (420, 26, 106001, 0, 0, 0, "え～～～～！？", "", 7, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (421, 27, 106001, 0, 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "", 8, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (422, 19, 106401, 0, 2, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", "", 8, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (423, 18, 105901, 0, 1, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "", 8, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (424, 24, 105801, 0, 3, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "", 8, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (425, 20, 106401, 0, 2, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "", 8, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (426, 28, 106001, 0, 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "", 8, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (427, 19, 105901, 0, 1, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "", 8, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (428, 21, 106401, 0, 2, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "", 8, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (429, 29, 106001, 0, 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "", 8, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (430, 30, 106001, 0, 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "", 8, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (431, 25, 105801, 0, 3, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "", 8, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (432, 31, 106001, 0, 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "", 8, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (433, 22, 106401, 0, 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (434, 23, 106401, 0, 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (435, 24, 106401, 0, 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (436, 25, 106401, 0, 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (437, 26, 106401, 0, 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (438, 27, 106401, 0, 0, 0, "それから、それから…！\nぅ、ぅぅっ…！", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (439, 28, 106401, 0, 0, 0, "―びえぇぇ～んっ！！！", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (440, 20, 105901, 0, 1, 0, "どうされましたか、シェフィさま", "", 9, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (441, 29, 106401, 0, 0, 0, "ううっ…ひっく…\nママッ…！", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (442, 21, 105901, 0, 1, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "", 9, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (443, 22, 105901, 0, 1, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "", 9, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (444, 30, 106401, 0, 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "", 9, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (445, 23, 105901, 0, 0, 0, "主さま\n3.5周年まであと５日\nでございます", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (446, 24, 105901, 0, 0, 0, "ですがその前に\n生放送がありますね", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (447, 25, 105901, 0, 0, 0, "…生放送に向けた\n意気込みでございますか？", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (448, 26, 105901, 0, 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (449, 27, 105901, 0, 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (450, 28, 105901, 0, 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (451, 29, 105901, 0, 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (452, 30, 105901, 0, 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (453, 31, 105901, 0, 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "", 10, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (454, 26, 105801, 0, 0, 0, "3.5周年まであと４日！\nやばいですね☆", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (455, 32, 106001, 0, 1, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "", 11, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (456, 27, 105801, 0, 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (457, 28, 105801, 0, 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (458, 29, 105801, 0, 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (459, 33, 106001, 0, 1, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "", 11, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (460, 30, 105801, 0, 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (461, 31, 105801, 0, 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (462, 32, 105801, 0, 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (463, 34, 106001, 0, 1, 0, "だからあたしはやるなんて一言も…", "", 11, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (464, 33, 105801, 0, 0, 0, "オイッスー☆", "", 11, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (465, 35, 106001, 0, 1, 0, "聞きなさいっての！！", "", 11, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (466, 31, 106401, 0, 2, 0, "3.5周年まであと３日…\nそして生放送は、明日…", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (467, 32, 106401, 0, 2, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (468, 33, 106401, 0, 2, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (469, 34, 106401, 0, 2, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (470, 35, 106401, 0, 2, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (471, 34, 105801, 0, 3, 0, "やってますねシェフィちゃん！", "", 12, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (472, 36, 106001, 0, 0, 0, "なによ、考えることは\nみんな同じってこと？", "", 12, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (473, 32, 105901, 0, 1, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "", 12, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (474, 36, 106401, 0, 2, 0, "みんな…もちろんよ！", "", 12, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (475, 35, 105801, 0, 3, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "", 12, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (476, 7, 190801, 0, 2, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (477, 8, 190801, 0, 2, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (478, 36, 105801, 0, 3, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "", 13, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (479, 9, 190801, 0, 2, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (480, 33, 105901, 0, 4, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "", 13, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (481, 10, 190801, 0, 2, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (482, 37, 106001, 0, 1, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", "", 13, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (483, 11, 190801, 0, 2, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (484, 37, 106401, 0, 0, 0, "あうー？", "", 13, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (485, 37, 105801, 1, 4, 0, "あ…", "105901,34,106001,38,190801,12", 13, 0, 80005, "みんな");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (486, 39, 106001, 0, 1, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "", 13, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (487, 35, 105901, 0, 4, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "", 13, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (488, 38, 105801, 0, 3, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "", 13, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (489, 13, 190801, 0, 2, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "", 13, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (490, 38, 106401, 0, 2, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "", 14, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (491, 39, 105801, 0, 3, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "", 14, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (492, 40, 106001, 0, 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "", 14, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (493, 36, 105901, 0, 1, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "", 14, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (494, 39, 106401, 0, 2, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "", 14, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (495, 40, 105801, 0, 3, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "", 14, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (496, 37, 105901, 0, 1, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "", 14, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (497, 41, 106001, 0, 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "", 14, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (498, 40, 106401, 0, 2, 0, "へ、へぇ…", "", 14, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (499, 41, 105801, 0, 3, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "", 14, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (500, 41, 106401, 0, 2, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "", 14, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (501, 42, 106401, 0, 2, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "", 14, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (502, 42, 105801, 0, 3, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "", 15, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (503, 42, 106001, 0, 1, 0, "祝！", "", 15, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (504, 38, 105901, 0, 4, 0, "3.5周年！", "", 15, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (505, 43, 106401, 0, 0, 0, "おめでとうございます！", "", 15, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (506, 14, 190801, 0, 2, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "", 15, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (507, 15, 190801, 0, 2, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "", 15, 0, 80005, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (508, 43, 105801, 0, 3, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "", 15, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (509, 44, 105801, 0, 3, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "", 15, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (510, 43, 106001, 0, 1, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "", 15, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (511, 44, 106001, 0, 1, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "", 15, 0, 80005, "キャル");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (512, 44, 106401, 0, 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "", 15, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (513, 45, 106401, 0, 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "", 15, 0, 80005, "シェフィ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (514, 39, 105901, 0, 4, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "", 15, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (515, 40, 105901, 0, 4, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "", 15, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (516, 41, 105901, 0, 4, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "", 15, 0, 80005, "コッコロ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (517, 45, 105801, 0, 3, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "", 15, 0, 80005, "ペコリーヌ");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (518, 46, 105801, 1, 4, 0, "これからも\nよろしくおねがいします！", "105901,42,106001,45,106401,46,190801,16", 15, 0, 80005, "みんな");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (519, 1, 190804, 0, 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 60003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (520, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "", 0, 1, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (521, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 1, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (522, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 0, 1, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (523, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", "", 0, 1, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (524, 0, 0, 0, 2, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 0, 1, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (525, 0, 0, 0, 2, 1, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "", 0, 2, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (526, 0, 0, 0, 2, 1, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "", 0, 2, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (527, 0, 0, 0, 2, 1, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", "", 0, 2, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (528, 0, 0, 0, 2, 1, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "", 0, 2, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (529, 0, 0, 0, 2, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 0, 2, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (530, 0, 0, 0, 2, 1, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (531, 0, 0, 0, 2, 1, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (532, 0, 0, 0, 2, 1, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (533, 0, 0, 0, 2, 1, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (534, 0, 0, 0, 2, 1, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (535, 0, 0, 0, 2, 1, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (536, 0, 0, 0, 2, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", "", 0, 3, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (537, 0, 0, 0, 2, 1, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (538, 0, 0, 0, 2, 1, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (539, 0, 0, 0, 2, 1, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (540, 0, 0, 0, 2, 1, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (541, 0, 0, 0, 2, 1, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (542, 0, 0, 0, 2, 1, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (543, 0, 0, 0, 2, 2, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", "", 0, 4, 60003, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (544, 2, 190804, 0, 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, 0, 60003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (545, 3, 190804, 0, 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 7, 0, 60003, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (546, 1, 190804, 0, 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "", 0, 0, 60004, "カリン");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (547, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "", 0, 1, 60004, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (548, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "", 0, 1, 60004, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (549, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", "", 0, 1, 60004, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (550, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", "", 0, 1, 60004, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (551, 0, 0, 0, 2, 1, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "", 0, 1, 60004, "");
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (552, 0, 0, 0, 2, 1, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "", 0, 2, 60004, "");
